syntax = "proto3";
package fanxi;
import "RestfulBaseResponse.proto";
option java_package = "com.fanxi.service.message";
option java_outer_classname = "InitRegisterResponseProto";

message InitRegisterResponse {
   RestfulBaseResponse baseResponse=1;
   string captchaToken= 5;
   string deviceId=6;
   string captcha=7;
   repeated string variant=8;
}




